export default (function(a,b,c,d,e,f,g,h,i){return {data:{IZaPgOZ6EO:{data:{id:2115,attributes:{imdbId:"tt0069103",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDM2MzU5ZDItMGMwZC00NzUzLWExNWYtNTM0ZTNjYTQ0MWZjXkEyXkFqcGdeQXVyMjUxODE0MDY@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"},{Source:"Metacritic",Value:"55\u002F100"}],item_lang:{data:{id:2778,attributes:{title:e,plot:"Jim Kane is a loser cowboy in Nogales, Arizona.He has more good nature than good sense and often takes jack-of-all-trades jobs. His bank loans are jeopardized when his latest horse purchase is a bust. His horses are quarantined with STD. Jim is broke. The local hotel clerk sympathetic about his situation lets him live in the hotel maid's room for free. His ex-wife goes gentle on him when he cannot make the alimony payments. Jim turns down his uncle's offer of a job but accepts a deal to buy cattle in Mexico for a shady businessman who has a bad reputation. Jim travels to Mexico where he teams up with another loser, an old friend by the name of Leonard, who moved to Mexico in order to pursue one of his many failed get-rich-quick schemes. The two amigos set out to buy Mexican cattle from various local ranchers but they experience difficulties and soon run into trouble.",slug:"pocket-money"}}},books:{data:[{id:10452,attributes:{title:f,description:g,thumbnail:h,authors:[b],firstBook:true,published:d,publisher:i,subtitle:a}},{id:10453,attributes:{title:f,description:g,thumbnail:h,authors:[b],firstBook:c,published:d,publisher:i,subtitle:a}},{id:10454,attributes:{title:e,description:"Cowboy Jim Kane's bank loan is due. So is his next alimony payment. And the Appaloosas he brought in from Mexico have been slapped into quarantine. What Jim needs is some pocket money.",thumbnail:a,authors:[b],firstBook:c,published:d,publisher:a,subtitle:a}},{id:10455,attributes:{title:"Wolves at Our Door",description:"Along the border of southern Arizona and northern Mexico, a close-knit group of Anglo and Hispanic families struggle to keep their ranches alive amidst the depredations of drug lords and smugglers. Here, age-old values collide with gangs of hardened border criminals. Ninety-nine percent of border traffic crosses American ranchland. Seventy-five-year-old Jim Kane's 7X ranch is right in the middle of today's border trouble. The people who come looking for work are trouble, but not a deadly threat. To Kane, the drug traffickers and the unscrupulous \"coyotes\" who traffic in poor people are the deadly threats to the nation.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=IMfLVOPEZhkC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2008-01-01",publisher:"UNM Press",subtitle:a}},{id:10456,attributes:{title:"Ladino",description:"Ben Cowden is no swaggering lover. He is a horseman, a stubborn son of Arizona. But now Ben is getting his lessons in the amorous arts--from the most beautiful woman he's ever laid eyes on. Margarita Elias Odoms is the unhappy new wife of the ex-Texas Ranger hired by ranch boss Duncan Vincent to drive the Cowdens out of Arizona. When Ben crosses into Sonora to save Margarita from despair, love turns to war. With a missing shipment of hijacked gold on the loose, and his sister Eileen in trouble with a crazy family named Bonner, Ben is already fighting on two fronts. But trouble always comes in threes; now there is a price on Ben's head and he must battle to the finish with a tall Texan, full of all the evil and greed that had brought him into this unforgiving, proud land...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tAyeBntQwh8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2005-01-01",publisher:"iUniverse",subtitle:"The Arizona Saga"}}]}}},meta:{}}},prerenderedAt:1680940941445}}("","J. P. S. Brown",null,"1970-01-01","Pocket Money","Jim Kane","Content with making an honest living hauling truckloads of horses from Mexico, Jim Kane--ranch hand, cattle trader, and bronco buster--is forced by a twist of fate to return to his job in Arizona, breaking colts for the rodeo.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=a2JeAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","E P Dutton"))